import { Radio} from '@mui/material';
import swal from '@sweetalert/with-react';


export const forgetPsswrd = () =>{
    swal({
        buttons: {
          cancel: "Cancelar",
          ok:"continuar"
        },
        content: (
            <div>
            <h1>¿Has olvidado tu contraseña?</h1>
            <p>Selecciona una opción de recuperación</p>
            <p><Radio value="a" name="radio-buttons" inputProps={{ 'aria-label': 'A' }} />Enviarme por correo electronico un codigo de recuperación </p>
            <p><Radio value="b" name="radio-buttons" inputProps={{ 'aria-label': 'B' }} />Responder preguntas de seguridad</p>
            
        </div>
        )
    })
}
export const click2 = ()=>{
    alert("Click2")
}
